import React, {useState, useEffect} from "react";
import "./Popular.css";
import data from "../../epicure.json";
import SingleRest from "../SingleRest/SingleRest";

const Popular: React.FC = () => {
  const popular: any[] = [
    {
      id: 4,
      name: 'Claro',
      address: [],
      chef: "Ran Shmueli",
      chefId: 1,
      open: 1,
      img: 'https://i.ibb.co/WnMSxk0/claro-3x.png',
      dishes: [],
      rating: "/image/rating/4.svg",
    },
    {
      id: 4,
      name: 'Lumina',
      address: [],
      chef: "Meir Adoni",
      chefId: 1,
      open: 1,
      img: "https://i.ibb.co/9HnJGWb/big-Lumina.png",
      dishes: [],
      rating: "/image/rating/4.svg",
    },
    {
      id: 4,
      name: 'Tiger Lilly',
      address: [],
      chef: "Yanir Green",
      chefId: 1,
      open: 1,
      img: "https://i.ibb.co/Q8GhmZG/tiger-lili.png",
      dishes: [],
      rating: "/image/rating/5.svg",
    },
  ];
  return (
    <>
      <div id="popular">
        <h1>popular restaurant in epicure:</h1>
        <div id="three-">
          {popular.map((rest) => {
            return <SingleRest restaurant={rest} />;
          })}
        </div>
        <button>All restaurants <img src="/image/vector.svg" alt="" /></button>
      </div>
    </>
  );
};

export default Popular;



